import React, { useMemo } from 'react';
import Member from './Member';

function Team({ Agenre, Bgenre, Cgenre }) {
  const candidates = [
    '민식',
    '무현',
    '대중',
    '기철',
    '회영',
    '민솔',
    '성묵',
    '희선',
    '대희',
    '영미',
    '소영',
    '알라',
  ];
  const newCandidates = candidates.sort((a, b) => {
    return parseInt(Math.random() * 10) - 5;
  });

  const teamA = newCandidates.splice(0, 4);
  const teamB = newCandidates.splice(0, 4);
  const teamC = newCandidates.splice(0, 4);
  const Mix = useMemo(Team);

  return (
    <div>
      {Agenre}팀:{' '}
      {teamA.map((member) => (
        <Member key={member} member={member}></Member>
      ))}
      <br />
      {Bgenre}팀: {teamB}
      <br />
      {Cgenre}팀: {teamC}
    </div>
  );
}

export default React.memo(Team);
